import React, { useState } from 'react';
import './Cards.css';

function Cards() {

    const [people, setPeople] = useState([
        {
            name: "Elon Musk",
            url: "https://upload.wikimedia.org/wikipedia/commons/8/85/Elon_Musk_Royal_Society_%28crop1%29.jpg",
        },
        {
            name: "Jeff Bezos",
            url: "https://upload.wikimedia.org/wikipedia/commons/8/85/Elon_Musk_Royal_Society_%28crop1%29.jpg",
        }
    ]);

    return (
        <div className='cards'>
            {people.map((person) => (
                <h1>{person.name}</h1>
            ))}
        </div>
    )
}

export default Cards;
